import Link from "next/link";
import Header from "../components/header";

export default () => (
  <main>
    <Header />

    <div className="logo">
      <img className="circle" src="../static/logo-files/ma-logo-circle.svg" alt=""/>
      <img className="text" src="../static/logo-files/ma-logo-text.svg" alt=""/>
    </div>

    <section>
      <Link href="/about">
        <a>Go to About Me</a>
      </Link>
    </section>
    <style jsx>{`
      .logo{
        width: 200px;
        height: 200px;
        background: gold;
      }
    `}</style>
  </main>
);
